// function to change background depending on weather conditions
function changeBackground(condition) {
  const body = document.querySelector("body");
  let bg = "";
  if (condition === "partly-cloudy-day") {
    bg = "https://i.ibb.co/qNv7NxZ/pc.webp";
  } else if (condition === "partly-cloudy-night") {
    bg = "https://i.ibb.co/RDfPqXz/pcn.jpg";
  } else if (condition === "rain") {
    bg = "https://i.ibb.co/h2p6Yhd/rain.webp";
  } else if (condition === "clear-day") {
    bg = "https://i.ibb.co/WGry01m/cd.jpg";
  } else if (condition === "clear-night") {
    bg = "https://i.ibb.co/kqtZ1Gx/cn.jpg";
  } else {
    bg = "https://i.ibb.co/qNv7NxZ/pc.webp";
  }
  body.style.backgroundImage = `linear-gradient( rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5) ),url(${bg})`;
}

//get hours from hh:mm:ss
function getHour(time) {
  let hour = time.split(":")[0];
  let min = time.split(":")[1];
  if (hour > 12) {
    hour = hour - 12;
    return `${hour}:${min} PM`;
  } else {
    return `${hour}:${min} AM`;
  }
}

// convert time to 12 hour format
function covertTimeTo12HourFormat(time) {
  let hour = time.split(":")[0];
  let minute = time.split(":")[1];
  let ampm = hour >= 12 ? "pm" : "am";
  hour = hour % 12;
  hour = hour ? hour : 12; // the hour '0' should be '12'
  hour = hour < 10 ? "0" + hour : hour;
  minute = minute < 10 ? "0" + minute : minute;
  let strTime = hour + ":" + minute + " " + ampm;
  return strTime;
}

// fun√ß√£o para obter name do dia a partir da data
function getDayName(date) {
    let day = new Date(date);
    let days = [
      "Domingo",
      "Segunda",
      "Ter√ßa",
      "Quarta",
      "Quinta",
      "Sexta",
      "S√°bado",
    ];
    return days[day.getDay()];
  }

// fun√ß√£o para obter status do √≠ndice UV
function measureUvIndex(uvIndex) {
    if (uvIndex <= 2) {
      uvText.innerText = "Baixo";
    } else if (uvIndex <= 5) {
      uvText.innerText = "Moderado";
    } else if (uvIndex <= 7) {
      uvText.innerText = "Alto";
    } else if (uvIndex <= 10) {
      uvText.innerText = "Muito Alto";
    } else {
      uvText.innerText = "Extremo";
    }
  }

// fun√ß√£o para obter status de umidade
function updateHumidityStatus(humidity) {
    if (humidity <= 30) {
      humidityStatus.innerText = "Baixa";
    } else if (humidity <= 60) {
      humidityStatus.innerText = "Moderada";
    } else {
      humidityStatus.innerText = "Alta";
    }
  }

  // fun√ß√£o para obter status de visibilidade
function updateVisibiltyStatus(visibility) {
    if (visibility <= 0.03) {
      visibilityStatus.innerText = "Nevoeiro Denso";
    } else if (visibility <= 0.16) {
      visibilityStatus.innerText = "Nevoeiro Moderado";
    } else if (visibility <= 0.35) {
      visibilityStatus.innerText = "Nevoeiro Leve";
    } else if (visibility <= 1.13) {
      visibilityStatus.innerText = "Muito Nevoeiro Leve";
    } else if (visibility <= 2.16) {
      visibilityStatus.innerText = "N√©voa Leve";
    } else if (visibility <= 5.4) {
      visibilityStatus.innerText = "N√©voa Muito Leve";
    } else if (visibility <= 10.8) {
      visibilityStatus.innerText = "Ar Limpo";
    } else {
      visibilityStatus.innerText = "Ar Muito Limpo";
    }
  }

// fun√ß√£o para obter status da qualidade do ar
function updateAirQualityStatus(airquality) {
    if (airquality <= 50) {
      airQualityStatus.innerText = "Boaüëå";
    } else if (airquality <= 100) {
      airQualityStatus.innerText = "Moderadaüòê";
    } else if (airquality <= 150) {
      airQualityStatus.innerText = "Prejudicial para Grupos Sens√≠veisüò∑";
    } else if (airquality <= 200) {
      airQualityStatus.innerText = "Prejudicialüò∑";
    } else if (airquality <= 250) {
      airQualityStatus.innerText = "Muito Prejudicialüò®";
    } else {
      airQualityStatus.innerText = "Perigosoüò±";
    }
  }

// function to handle search form
searchForm.addEventListener("submit", (e) => {
  e.preventDefault();
  let location = search.value;
  if (location) {
    currentCity = location;
    getWeatherData(location, currentUnit, hourlyorWeek);
  }
});

// function to conver celcius to fahrenheit
function celciusToFahrenheit(temp) {
  return ((temp * 9) / 5 + 32).toFixed(1);
}


var currentFocus;
search.addEventListener("input", function (e) {
  removeSuggestions();
  var a,
    b,
    i,
    val = this.value;
  if (!val) {
    return false;
  }
  currentFocus = -1;

  a = document.createElement("ul");
  a.setAttribute("id", "suggestions");

  this.parentNode.appendChild(a);

  for (i = 0; i < cities.length; i++) {
    /*check if the item starts with the same letters as the text field value:*/
    if (
      cities[i].name.substr(0, val.length).toUpperCase() == val.toUpperCase()
    ) {
      /*create a li element for each matching element:*/
      b = document.createElement("li");
      /*make the matching letters bold:*/
      b.innerHTML =
        "<strong>" + cities[i].name.substr(0, val.length) + "</strong>";
      b.innerHTML += cities[i].name.substr(val.length);
      /*insert a input field that will hold the current array item's value:*/
      b.innerHTML += "<input type='hidden' value='" + cities[i].name + "'>";
      /*execute a function when someone clicks on the item value (DIV element):*/
      b.addEventListener("click", function (e) {
        /*insert the value for the autocomplete text field:*/
        search.value = this.getElementsByTagName("input")[0].value;
        removeSuggestions();
      });

      a.appendChild(b);
    }
  }
});
/*execute a function presses a key on the keyboard:*/
search.addEventListener("keydown", function (e) {
  var x = document.getElementById("suggestions");
  if (x) x = x.getElementsByTagName("li");
  if (e.keyCode == 40) {
    /*If the arrow DOWN key
      is pressed,
      increase the currentFocus variable:*/
    currentFocus++;
    /*and and make the current item more visible:*/
    addActive(x);
  } else if (e.keyCode == 38) {
    /*If the arrow UP key
      is pressed,
      decrease the currentFocus variable:*/
    currentFocus--;
    /*and and make the current item more visible:*/
    addActive(x);
  }
  if (e.keyCode == 13) {
    /*If the ENTER key is pressed, prevent the form from being submitted,*/
    e.preventDefault();
    if (currentFocus > -1) {
      /*and simulate a click on the "active" item:*/
      if (x) x[currentFocus].click();
    }
  }
});
function addActive(x) {
  /*a function to classify an item as "active":*/
  if (!x) return false;
  /*start by removing the "active" class on all items:*/
  removeActive(x);
  if (currentFocus >= x.length) currentFocus = 0;
  if (currentFocus < 0) currentFocus = x.length - 1;
  /*add class "autocomplete-active":*/
  x[currentFocus].classList.add("active");
}
function removeActive(x) {
  /*a function to remove the "active" class from all autocomplete items:*/
  for (var i = 0; i < x.length; i++) {
    x[i].classList.remove("active");
  }
}

function removeSuggestions() {
  var x = document.getElementById("suggestions");
  if (x) x.parentNode.removeChild(x);
}

fahrenheitBtn.addEventListener("click", () => {
  changeUnit("f");
});
celciusBtn.addEventListener("click", () => {
  changeUnit("c");
});

// function to change unit
function changeUnit(unit) {
  if (currentUnit !== unit) {
    currentUnit = unit;
    tempUnit.forEach((elem) => {
      elem.innerText = `¬∞${unit.toUpperCase()}`;
    });
    if (unit === "c") {
      celciusBtn.classList.add("active");
      fahrenheitBtn.classList.remove("active");
    } else {
      celciusBtn.classList.remove("active");
      fahrenheitBtn.classList.add("active");
    }
    getWeatherData(currentCity, currentUnit, hourlyorWeek);
  }
}

hourlyBtn.addEventListener("click", () => {
  changeTimeSpan("hourly");
});
weekBtn.addEventListener("click", () => {
  changeTimeSpan("week");
});

// function to change hourly to weekly or vice versa
function changeTimeSpan(unit) {
  if (hourlyorWeek !== unit) {
    hourlyorWeek = unit;
    if (unit === "hourly") {
      hourlyBtn.classList.add("active");
      weekBtn.classList.remove("active");
    } else {
      hourlyBtn.classList.remove("active");
      weekBtn.classList.add("active");
    }
    getWeatherData(currentCity, currentUnit, hourlyorWeek);
  }
}




